const MusicMakerBottom = ({playSong}) => {
  return (
    <div className=" w-[80rem] h-[5rem] ">
      <button onClick={playSong}>Play</button>
      <div id="tempoControlsContainer">
          <label id="tempLabel">Tempo</label>
          <input type="range" id="tempoRange" min='88' max="148" />
          <span id="currentTempoVisual">88</span>
      </div>
    </div>
  )
}

export default MusicMakerBottom
